package dp;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class OriginalTypeString {
    private static final int MOD = 1000000007;
    private int countRepeat(List<Integer> reps, String word) {
        int first = 0; //连续相同字符第一次出现的位置
        int rep = 0;
        int acc = 0;
        for (int i = 1; i < word.length(); i++) {
            if (word.charAt(first) == word.charAt(i)) {
                rep++;
            } else {
                first = i;
                if (rep != 0) {
                    acc += rep;
                    reps.add(rep);
                }
                rep = 0;
            }
        }
        if (rep != 0) {
            reps.add(rep);
            acc += rep;
        }
        return acc;
    }
    // 从arr的 idx~len位置的元素累计减去d，方案数
    private int process(int[] arr, int idx, int d) {
        if (idx == arr.length) {
            return d == 0 ? 1 : 0;
        }
        if (d == 0) {
            return 1;
        }
        int ans = 0;
        // idx位置 去掉min(i, arr[idx])
        for (int i = 0; i <= d; i++) {
            if (i > arr[idx]) {
                break;
            }
            ans += process(arr, idx + 1, d - i) % MOD;
        }
        return ans;
    }

    public int possibleStringCount1(String word, int k) {
        if (word.length() == 1 || k >= word.length()) {
            return 1;
        }
        // 连续相同字符重复的次数
        List<Integer> repFreqs = new ArrayList<>();
        int acc = countRepeat(repFreqs, word);
        int firsts = word.length() - acc; // 8 - 5 = 3
        // 从集合中总共减去[0,len-k] 生成的结果有几种
        int[] arr = new int[repFreqs.size()];
        int l = 0;
        for (int f : repFreqs) {
            arr[l++] = f;
        }

        // 至少想输入k个 L-L ~ L-K 是acc中多余的字符数
        // 至多想输入k-1个 如果firsts==k-1 那不能再少，刚好1种；如果firsts>k-1，没有可能
        // 有多少种可能 -- acc<<1
        // 删除多少字符 --
        // 0~k-1是要保留的字符个数
        long ans = 1;
        for (int i : repFreqs) {
            ans = (ans * (i+1)) % MOD;
        }
        if (firsts > k - 1) {
            return (int) ans;
        }
        if (firsts == k - 1) {
            return (int) (ans - 1);
        }
        // firsts是最少输入字符数，k-1是最多字符数，k-1-first是从arr中最多补充的字符数
        int[] dp = new int[k - 1 - firsts + 1]; // 二维变成一维 压缩空间
        dp[0] = 1;
        int a = dp(arr, dp);

        int delta = (int) (ans - a);
        return delta <= 0 ? delta + MOD : delta;
    }

    // 将arr中的数字累计减掉0~(k-1-firsts) 返回方案数
    int dp(int[] arr, int[] dp) {
        int[] newDp = new int[dp.length];
        newDp[0] = 1;

        for (int i = arr.length-1; i >= 0; i--) {
            for (int j = 1; j < dp.length; j++) {
                newDp[j] = newDp[j-1];
                if (j > arr[i]) {
                    newDp[j] -= dp[j - arr[i] - 1];
                    if (newDp[j] <=0)
                        newDp[j] += MOD;
                }
                newDp[j] = (newDp[j] + dp[j]) % MOD;
            }
            // newDp变成dp，newDp会被覆盖
            int[] tmp = dp;
            dp = newDp;
            newDp = tmp;
        }

        int ans = 0;
        for (int i = 0; i < dp.length; i++) {
            ans = (ans + dp[i]) % MOD;
        }
        return ans;
    }

    public static void main(String[] args) {
        final OriginalTypeString origin = new OriginalTypeString();
        String s = "";
//        String s = "aabbbccc";
        int k = 1924; // 至少想输入的长度
//        int k = 5; // 至少想输入的长度 需要删除1或0个 补集：需要pick1个或2个
        // k=3则 bbc bcc；k=4则bbcc bccc；k=5则原来的
        // k=3, rest=2; k=4, rest=1; k=5; rest=0
//        final int count = origin.possibleStringCount(s, k);
//        System.out.println(count);
        long start = System.currentTimeMillis();
        int count1 = origin.possibleStringCount1(s, k); // 756148912
        System.out.println("time cost:" + (System.currentTimeMillis() - start));
        System.out.println(count1);
    }
}

